import React from "react";

function AddCard () {
  return (
    <div>
      <h2>DeckName: Add Card</h2>
      <div class="form-group">
        <label for="frontText">Front</label>
        <textarea class="form-control" id="frontText" rows="3"></textarea>
      </div>
      <div class="form-group">
        <label for="backText">Back</label>
        <textarea class="form-control" id="backText" rows="3"></textarea>
      </div>
    </div>
  );
}

export default AddCard;
